import React, {useState, useEffect} from 'react';
import { useHistory } from 'react-router-dom';

import '../App.css';
import cmpositeSampleTypesAPI from "../api/cmpositeSampleTypesAPI";
import CompositeSampleType from "./_cmpositeSampleType";

const CompositeSampleTypesPage = () => {
  const history = useHistory();
  // default cmpositeSampleTypes to empty array
  const [cmpositeSampleTypes, setCompositeSampleTypes] = useState([]);

  useEffect(() => {
    const init = async () => {
      // get cmpositeSampleTypes
      const response = await cmpositeSampleTypesAPI.getCompositeSampleTypes();
      if (!response) return;

      // success
      setCompositeSampleTypes(response);
    };

    init();
  }, []);

  const newCompositeSampleType = () => {
    history.push('/sample_types/new')
  }

  return (
    <>
      <div class='breadcrumbs'>
        CompositeSampleTypes
        <span></span>
        <button onClick={() => newCompositeSampleType()}>New CompositeSampleType</button>
      </div>

      <div className="flex flex-title">
        <div className="flex-col-1">
          Name
        </div>
        <div className="flex-col-2">
          Description
        </div>
      </div>

      {cmpositeSampleTypes.map((cmpositeSampleType) => (
        <CompositeSampleType cmpositeSampleType={cmpositeSampleType} />
      ))}
    </>
  );
}

export default CompositeSampleTypesPage;
